import React from "react";
import { Container } from "react-bootstrap";
import Beitrag from "../Beitrag";

var beitraegesum;
const BeitragDeck = (props) => {
  let beitraege = props.data
  if(beitraege === undefined || beitraege === 0 || beitraege === null)return(<h3 className = "m-5">Beitraege nicht geladen</h3>);
  if(beitraegesum === null || beitraegesum === undefined)beitraegesum = beitraege;
  else beitraegesum.apply.push(beitraege,apply)
  return (
    <Container className = {props.className2}>
        {beitraegesum.map((e,i) => {
          return (<Beitrag  name = {e.ueberschrift} text = {e.text} img = {e.img} ersteller = {e.ersteller} key1 = {i} likes = {e.likes}/>)
        })}
      </Container>
  );
};

export default BeitragDeck;
